import React from 'react'
import Nav from '../Components/Nav/Nav';
import styled from 'styled-components';

const ItemGrid = styled.div`
    display: grid;
    grid-template-columns: 500px 200px 200px;
    grid-gap: 10px;
`;

function ShoppingBag() {
    return (
        <div style={{minHeight: 'calc(100vh - 120px)', display: 'flex', justifyContent: 'center', alignItems: 'start'}}>
            <div style={{margin: '5%'}}>
                <h1 style={{marginBottom: '30px'}}>Shopping Bag</h1>
                <div style={{marginTop: '30px', borderTop: 'solid rgb(224, 224, 224) 4px', paddingTop: '20px'}}>
                    <ItemGrid>
                        <p>PRODUCT DETAILS</p>
                        <p>QTY</p>
                        <p>TOTAL</p>
                    </ItemGrid>


                </div>
            </div>

            <div style={{width: '300px', height: '50vh', border: '1px solid black', margin: '5%'}}>

            </div>

        </div>
    )
}

export default ShoppingBag
